import React from 'react'
import { createRoot } from 'react-dom/client'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import * as socketIO from 'socket.io-client';
// import { io } from "socket.io-client";

//pages and components
import Header from './components/Header'
import Home from './pages/Home'
import Settings from './pages/Settings'
import Footer from './components/Footer'
import Chat from './pages/Chat'
import Error404 from './pages/Error404'
import Friends from './pages/Friends'
import StatsAndMatch from './pages/StatsAndMatch'
import WatchLive from './pages/WatchLive'
import TheConv from './components/AllConv/theconv'
import ChatWidget from './src_chat/component/ChatWidget'
import PrintProfile from './pages/Profile'
import './src_chat/index.css';

const socket = socketIO.connect('http://localhost:4000');
// const root = ReactDOM.createRoot(document.getElementById("root") as HTMLElement);
const rootElement = document.getElementById('root')
if (!rootElement) throw new Error('Failed to find the root element')
const root = createRoot(rootElement)

root.render(
    <React.StrictMode>
        <Router>
            <Header />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/userparams" element={<Settings />} />{' '}
                {/* Change user in login (login/amontautparams) + cannot acces page if not logged in*/}
                <Route path="/Friends" element={<Friends />} />
                <Route path="/StatsAndMatch" element={<StatsAndMatch />} />
                <Route path="/Chat" element={<Chat />} />
                <Route path="/Chat/conv" element={<TheConv />}></Route>
                <Route path="/chat/try" element={<ChatWidget socket={socket} username={'alice'} room={1}/>}></Route>
                <Route path="/WatchGame" element={<WatchLive />} />
                <Route path="/PrintProfile/:username" element={<PrintProfile/>} />
                <Route path="*" element={<Error404 />} />
            </Routes>
            <Footer />
        </Router>
    </React.StrictMode>
)
